import React, { Component } from "react";
import "./experience.scss";
export default class ExpereinceCard extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="container1">
        <div className="card1">
          <img src="//unsplash.it/399/400" alt="" className="card1-img"></img>
          <div className="card1-text">
            <h3 className="card1-title">{this.props.data.title}</h3>
            <p className=" card1-body">{this.props.data.desc}</p>
          </div>
        </div>
      </div>
    );
  }
}
